import React, {Component} from 'react'
import {BookCard} from '../bookCardComponent/bookCard'

export class BookContainer extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div className="container-fluid" style={{backgroundColor: '#1429D7'}}>
                <div className="container row" style={{backgroundColor: 'transparent',margin: '50px auto'}}>
                    <div className="col-11 col-md-2 ml-5 mt-2" style={{borderTop: '3px solid white',color: 'white'}}>
                        <label>
                            {this.props.title}
                        </label>
                    </div>

                    <BookCard serial='0' title='Kỷ nguyên Trí tuệ Nhân tạo'/>
                    <BookCard serial='1' title='Chạy đua với Robot'/>
                    <BookCard serial='2' title='Năm 2062 Thời đại của trí thông minh nhân tạo'/>
                    <BookCard serial='3' title='The A.I. Age'/>
                </div>
            </div>

        )
    }
}
